import { Routes, Route } from "react-router-dom";
import IndexPage from "../pages/indexPage/IndexPage";



const AppRoutes = () => {
    return (
        <>
            <Routes>
                <Route
                    path="/"
                    element={<IndexPage />}
                ></Route>
                <Route
                    path="/:id"
                    element={<IndexPage />}
                ></Route>
            </Routes>

        </>
    )
}

export default AppRoutes
